import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {

  constructor(){
    super();

    this.state ={
      monsters: [{
      name: 'Fankestein'
    },
    {
      name: 'Dracula'
    },
    {
      name: 'zombie'
    }]};

  }

  render(){
    return(
      <div className = 'App'>
      {
        this.state.monsters.map(monster => <h1>{monster.na}</h1>)
      }
      </div>
    )
  }

}

export default App;
